import React from 'react';
import { Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';

var sectionStyle = {
    width: '100%',
    height: "400rem",
    backgroundRepeat: "noRepeat",
    backgroundImage: "url("+'https://www.google.com/url?sa=i&source=images&cd=&ved=2ahUKEwj4uJ_3k5jmAhXhuFkKHTVDBgkQjRx6BAgBEAQ&url=https%3A%2F%2Fwww.123rf.com%2Fphoto_60303585_abstract-buildings-background.html&psig=AOvVaw1Jx3aYn_1Ll5FZw4JAVeyL&ust=1575417027084467' + ")"
    
  };
class HomePage extends React.Component {
    
    render(){
        return(
            <div style = {{ margin: '5rem'}}>
                <Grid
                style= {sectionStyle}
                container
                direction="row"
                justify="center"
                 alignItems="center"
                >
                    
                </Grid>
            </div>

        )
    }

}
export default HomePage;
